import React from 'react';
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';

const responsive = {
  0: { items: 1 },
  568: { items: 5 },
  1024: { items: 8 },
};

const items = [
  <div className="item c-img" data-value="1">
    <img src="https://smarthamster.tech/assets/images/etherium.png" />
  </div>,
  <div className="item c-img" data-value="2">
    2
  </div>,
  <div className="item c-img" data-value="3">
    3
  </div>,
  <div className="item c-img" data-value="4">
    4
  </div>,
  <div className="item c-img" data-value="5">
    5
  </div>,
  <div className="item c-img" data-value="6">
    6
  </div>,
  <div className="item c-img" data-value="7">
    7
  </div>,
  <div className="item c-img" data-value="8">
    8
  </div>,
  <div className="item c-img" data-value="9">
    9
  </div>,
];

const Caroucel = () => {
  return (
    <AliceCarousel
      mouseTracking
      items={items}
      responsive={responsive}
      controlsStrategy="alternate"
    />
  );
};

export default Caroucel;
